import Axios from "axios"
import { CART_ADD_ITEM } from "../constants/cartConstants.js";

const addToCart = (puppyId, stats) => async (dispatch) => {

    try{
     const {data} = await Axios.get("/api/puppies/" + puppyId);
    dispatch({
    type: CART_ADD_ITEM, payload:{
        puppy: data._id,
        name: data.name,
        image: data.image,
        price: data.price,
        stats: data.stats

    }});

    } catch (error) {


    }
}
export {addToCart};
